import React from 'react';
import { Container, Typography, Box, Paper, Stepper, Step, StepLabel, StepContent } from '@mui/material';
import { styled } from '@mui/material/styles';
import LinkIcon from '@mui/icons-material/Link';
import VideoLibraryIcon from '@mui/icons-material/VideoLibrary';
import DownloadIcon from '@mui/icons-material/Download';
import PlayCircleOutlineIcon from '@mui/icons-material/PlayCircleOutline';

const GlassContainer = styled(Paper)({
  background: 'linear-gradient(135deg, rgba(26, 26, 46, 0.8) 0%, rgba(22, 33, 62, 0.8) 100%)',
  backdropFilter: 'blur(16px)',
  borderRadius: '20px',
  border: '1px solid rgba(255, 255, 255, 0.1)',
  padding: '2rem',
  marginTop: '2rem',
  color: 'white',
  boxShadow: '0 8px 32px 0 rgba(103, 58, 183, 0.2)',
});

const Title = styled(Typography)({
  marginBottom: '3rem',
  position: 'relative',
  textAlign: 'center',
  '&::after': {
    content: '""',
    position: 'absolute',
    bottom: '-10px',
    left: '50%',
    transform: 'translateX(-50%)',
    width: '100px',
    height: '3px',
    background: 'linear-gradient(90deg, transparent, #673ab7, transparent)',
  },
});

const StyledStepper = styled(Stepper)({
  '& .MuiStepLabel-label': {
    color: 'rgba(255, 255, 255, 0.8)',
    '&.Mui-active': {
      color: '#673ab7',
    },
    '&.Mui-completed': {
      color: '#4caf50',
    },
  },
  '& .MuiStepIcon-root': {
    color: 'rgba(255, 255, 255, 0.3)',
    '&.Mui-active': {
      color: '#673ab7',
    },
    '&.Mui-completed': {
      color: '#4caf50',
    },
  },
  '& .MuiStepConnector-line': {
    borderColor: 'rgba(255, 255, 255, 0.1)',
  },
});

const StepBox = styled(Box)({
  padding: '1rem',
  background: 'rgba(255, 255, 255, 0.05)',
  borderRadius: '10px',
  marginTop: '1rem',
  border: '1px solid rgba(255, 255, 255, 0.1)',
});

const IconWrapper = styled(Box)({
  display: 'flex',
  alignItems: 'center',
  gap: '0.5rem',
  marginBottom: '1rem',
  '& .MuiSvgIcon-root': {
    color: '#673ab7',
    fontSize: '2rem',
  },
});

const steps = [
  {
    label: 'نسخ رابط الفيديو',
    description: 'قم بنسخ رابط فيديو يوتيوب الذي تريد تحميله من المتصفح',
    icon: <LinkIcon />,
    details: [
      'افتح موقع يوتيوب في المتصفح',
      'اختر الفيديو المطلوب',
      'انسخ الرابط من شريط العنوان أو من زر المشاركة',
    ],
  },
  {
    label: 'لصق الرابط',
    description: 'الصق رابط الفيديو في مربع إدخال الرابط في الصفحة الرئيسية',
    icon: <VideoLibraryIcon />,
    details: [
      'الصق الرابط في مربع الإدخال',
      'اضغط على زر "تحميل" أو مفتاح Enter',
      'انتظر حتى يتم تحليل الفيديو وعرض المعلومات',
    ],
  },
  {
    label: 'اختيار الجودة',
    description: 'اختر جودة التحميل المناسبة من القائمة المتاحة',
    icon: <PlayCircleOutlineIcon />,
    details: [
      'اختر من بين الجودات المتاحة (144p إلى 4K)',
      'يمكنك اختيار تحميل الصوت فقط',
      'تحقق من حجم الملف قبل التحميل',
    ],
  },
  {
    label: 'بدء التحميل',
    description: 'اضغط على زر التحميل وانتظر حتى يكتمل التحميل',
    icon: <DownloadIcon />,
    details: [
      'اضغط على زر "تحميل" للجودة المختارة',
      'اختر مكان حفظ الملف على جهازك',
      'انتظر حتى يكتمل التحميل',
    ],
  },
];

const HowToUse = () => {
  return (
    <Container maxWidth="lg">
      <GlassContainer elevation={3}>
        <Title variant="h4" component="h1">
          كيفية الاستخدام
        </Title>

        <StyledStepper orientation="vertical">
          {steps.map((step, index) => (
            <Step key={index} active={true}>
              <StepLabel>
                <Typography variant="h6" sx={{ color: 'white', mb: 1 }}>
                  {step.label}
                </Typography>
              </StepLabel>
              <StepContent>
                <IconWrapper>
                  {step.icon}
                  <Typography variant="body1" sx={{ color: 'rgba(255, 255, 255, 0.9)' }}>
                    {step.description}
                  </Typography>
                </IconWrapper>
                <StepBox>
                  <Box component="ul" sx={{ m: 0, pl: 2 }}>
                    {step.details.map((detail, idx) => (
                      <Typography
                        key={idx}
                        component="li"
                        variant="body2"
                        sx={{ color: 'rgba(255, 255, 255, 0.7)', mb: 1 }}
                      >
                        {detail}
                      </Typography>
                    ))}
                  </Box>
                </StepBox>
              </StepContent>
            </Step>
          ))}
        </StyledStepper>
      </GlassContainer>
    </Container>
  );
};

export default HowToUse;
